import styles from "./SideNavBar.module.css";

const SideNavBar = ({ tabs, selectedTab, setSelectedTab }) => {
  const selectedTabStyle = {
    color: "black",
    fontSize: "25px",
    fontWeight: 500,
  };
  return (
    <div className={styles.nav_body}>
      {tabs.map((tab, index) => {
        return (
          <div
            className={styles.nav_element}
            style={selectedTab === 0 ? selectedTabStyle : null}
            onClick={setSelectedTab()}
          >
            About Me
          </div>
        );
      })}
      <div className={styles.nav_element}>Experience</div>
      <div className={styles.nav_element}>Projects</div>
      <div className={styles.nav_element}>Skills</div>
      <div className={styles.nav_element}>Contact</div>
    </div>
  );
};

export default SideNavBar;
